import React from "react";
import Header from "./components/Login/Header1";
import Navbar1 from "./components/Navbar1";
import BeitragDeck from "./components/Browsing/BeitragDeck";

const IndexPage = () => { 
  let beitraege = fetchdata("Entdecke/?Page=0&seed=1")
  
    beitraege.then(function(data){
      console.log(data)
    })

  return (
    <div>
      <Navbar1 className="m-0"></Navbar1>
      <Header str="Entdecke" className="m-0"></Header>
      <BeitragDeck></BeitragDeck>
    </div>
  );
};

export default IndexPage;

export async function postDataauth(url = "", data = {}) {
  const response = await fetch(url, {
    method: "POST",
    mode: "cors",
    cache: "no-cache",
    credentials: "same-origin",
    headers: {
      "Content-Type": "application/json",
      charset: "UTF-8",
      Authorization: "Bearer " + localStorage.jwt,
    },
    redirect: "follow",
    referrerPolicy: "no-referrer",
    body: JSON.stringify(data),
  });
  return response.json();
}

async function fetchdata(url) {
  const response = await fetch(localStorage.ip +url, {
    headers: {
      Authorization: "Bearer " + localStorage.jwt,
    },
  });

  return response.json();
}
